import React from 'react';
import ToggleButton from '@material-ui/lab/ToggleButton';


export default function StandaloneToggleButton(props) {
  const [selected, setSelected] = React.useState(false);

  return (
      <ToggleButton
        value="check"
        selected={selected}
        onChange={() => {
          setSelected(!selected);
        }}
      >
      {props.text}

      </ToggleButton>

  );
}
